import logo from './logo.svg';
import './App.css';
import { Route, Router } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import HomeComponent from './components/Home';

function App() {
  return (
    <div className="App">
       <Router>
        <Route path="/" element={<HomeComponent />} />
      </Router>
    </div>
  );
}

export default App;
